import "./App.css";
import { BrowserRouter, Router } from "react-router-dom";
import Home from "./Components/Home/Home";

function App() {
  return (
    <BrowserRouter>
      <Router exact path="/" component={Home} />
    </BrowserRouter>
  );
}

export default App;
